import customer from './customerHeader'
import 'bootstrap/dist/css/bootstrap.min.css';

export default function customerHeader() {
  return (
    <div>
      <input placeholder='Customer Id' className='idText' type="text" name="id"  />

     
     <input placeholder='Customer Name' className='idText' type="text" name="name"/>


     <input placeholder='Customer Address' className='idText' type="text" name="address"  />


      <input placeholder='Customer Age' className='idText' type="text" name="age"  />

    </div>
  )
}
